INSERT INTO `atelier` (`idAtelier`, `nom`, `date`, `description`, `heure`, `age`, `capacite`) VALUES
	(1, 'La Lune a disparu', '2020-05-15 10:00:00', 'Le château ou castelet avait été fabriqué pour l’exposi-tion  « Vivre au cœur des grandes cours de l’histoire »  en 2012, notamment pour raconter des histoires. Le profes-seur d’arts plastiques a fabriqué une hutte avec un vieux livre (Book Art) au cours d’ateliers ayant eu lieu en 2013. L’idée était donc d’utiliser ces éléments pour raconter une histoire dans le cadre d’une thématique sur les dé-chets et l’environnement : « La lune a disparu ».Le château est caché derrière le rideau du théâtre dans la salle conte. Ouverture du rideau, le château s’avance (sur roulette) et la petite fille apparaît. L’histoire débute. ', '10:00:00', '3 à 10', 15),
	(2, 'Speed-booking', '2020-07-07 10:00:00', 'Accueil des participants et installation aux différentes tablesLe top départ est donné par le meneur de jeu qui scande les échanges et les changements de tables toutes les sept minutes par un signal sonore. Dans ce laps de temps, les participants échangent sur leurs coups de cœur aux thématiques diverses. À l’issue de l’animation, les participants décident avec qui ils échangent véritablement leurs coups de cœur.CONTRAINTESNos deux habitantes sont des femmes actives, elles n’ont pas pu maintenir l’animation et aucun habitant n’a pris le relais malgré l’engouement pour cet événement.  L’anima-tion suscitait de la curiosité, de l’intérêt mais la fréquen-tation était aléatoire.', '10:00:00', '18', 10),
	(3, 'Décor de valises thémmatiques', '2020-06-18 10:00:00', 'DESCRIPTIF DE L’ANIMATIONAppel à participation (début septembre) pour la déco-ration de valises qui seront mises en exposition. L’idée est d’orner une valise selon une thématique particulière en lien avec la littérature (Sherlock Holmes, comtesse de Ségur, etc.) Réception des valises (fin septembre)  Communication (presse, site, page FB, newsletter, af-fiches et flyers) dernière semaine de septembre.Installation de l’exposition (fin septembre)Animations autour des valises en octobre, dont visite de l’exposition avec l’école et ateliers de mots valises avec les primaires.', '10:00:00', '8 ', 12),
	(4, 'Fais ton film', '2020-07-20 10:00:00', 'Par groupes, réfléchir à un synopsis(mot à expliquer) avant de mettre en mouvement le(s) personnage(s).\r\nFournir aux enfants un tableau avec des vignettes vierges numérotées pour \r\nélaborer leur scénario.\r\nPrise de photos: déplacer petit à petit les élements en papier sur le décor en photographiant chaque étapes\r\ndes mouvements. Les enfants peuvent se relayer pour la prise des photos et le déplacement des différents élements.', '10:00:00', '9 à 13', 10),
	(5, 'Bibliobingo', '2020-03-29 13:06:44', ' carte de bingo possède neuf cases avec neuf thèmes. Il faut lire un livre correspondant à chaque ', '13:07:18', '8 ', 11),
	(6, 'Action sur la broderie', '2020-03-09 13:07:42', 'Expositions de différents types ', '13:07:57', '15 ', 11),
	(7, 'le bilann', '2020-05-06 00:00:00', 'trzreg', '12:11:00', '4', 8);
