INSERT INTO `faq` (`idFAQ`, `question`, `reponse`) VALUES
	(1, 'Comment s\'inscrire  à l\'espace Adhérent ?', 'Toutes les inscriptions sont à faire à la bibliothèque municipale.'),
	(3, 'Comment S\'inscrire sur l\'application.', 'Au moment de votre inscription à la bibliothèque. Nous vous donneront votre numéro d\'adhérent. A partir de ce momemt là vous pourrez-vous inscrire sur le site.'),
	(4, 'Vous ne parvenez pas à vous connecter à votre compte.', 'Verifier bien votre numéro d\'adhérent.'),
	(5, 'Que vais-je trouver dans mon espace Adhérent ? ', 'Mes informations personnelles, la gestion de mon compte Adhérent.'),
	(6, 'J\'ai perdu ou oublié mon mot de passe ? ', 'Après avoir saisi votre adresse e-mail permettant de vérifier votre identité,\r\n un lien d\'activation vous sera adressé par e-mail.'),
	(7, 'Je souhaiterais connaître les horaires de la bibliothèque.', 'Du lundi au vendredi : 9h00-12h00 / 14h00-18h00.'),
	(8, 'J\'ai abîmés un livre, comment cela se passe ?', 'Tout livre abîmé pourra être facturé. Si cela arrive trop souvent.'),
	(9, 'À qui dois-je m\'adresser en cas de réclamation ?', ' En cas de litige, vous pouvez prendre contact avec nos équipes : De la Mairie.'),
	(10, 'Je suis sourd ou malentendant et je souhaite être accompagné.', 'Vous pouvez vous faire accompagnées, il vous suffit de prendre rendez-vous à la bibliothèque. Voici le numéro 06.06.06.06.06');
INSERT INTO `livre` (`idLivre`, `idCategorie`, `idAuteur`, `idEditeur`, `nom`, `image`, `enSavoirPlus`, `dateDePublication`, `description`, `disponible`, `nbDePage`, `dimension`, `langue`, `isbn`, `ean`) VALUES
	(1, 1, 3, 1, 'Soulages', _binary , '(NULL)', '2020-02-21 11:11:09', 'Du noir ? Oui, mais pas seulement. "La toile se fait devant vous, en fonction de vous, au moment de votre regard et à l\'endroit où vous la découvrez." Approchez, Pierre Soulages nous invite littéralement dans son oeuvre. Ni paysages ni portraits chez lui : il s\'exprime simplement avec les formes et les couleurs, joue avec la lumière, et laisse nos sens et notre imaginaire faire le reste... Et vous allez être surpris du résultat ! En marge de tous les courants, il a créé une oeuvre d\'une rare beauté, aujourd\'hui reconnue et exposée dans le monde entier.', 'oui', 10, '10', 'fr', '123456', '9782844268679'),
	(2, 1, 1, 1, 'Charlie Parker', _binary , NULL, '2020-02-12 01:59:53', 'Franck Médioni est journaliste et écrivain. Il a collaboré à Jazz magazine et a été producteur de l’émission « Jazzististiques » sur France Musique. Parmi une œuvre foisonnante dont plusieurs livres d’entretiens (Martial Solal, Joëlle Léandre, Sonny Rollins, Daniel Humair), il est l’auteur de John Coltrane, 80 musiciens de jazz témoignent (Actes Sud), Miles Davis, 80 musiciens de jazz témoignent (Actes Sud), Jimi Hendrix (Gallimard), George Gershwin (Gallimard) et John Coltrane, l’amour suprême (Le Castor astral).', 'oui', 308, '13,5 x 2,3 x 21,5 cm', ' Français', '978-2213709871', '9782213709871'),
	(4, 1, 2, 24, 'La vie est plus belle en musique', _binary , NULL, '2020-02-12 02:04:34', '« La musique est partout, pour qui la cherche, l’écoute, la reconnaît. Elle est cette présence vitale qui remplit l’espace et ne demande qu’à être révélée.', 'oui', 98, NULL, ' Français', NULL, '9782290210017'),
	(5, 1, 4, 2, 'Les Beatles', _binary , NULL, '2020-01-30 02:42:58', 'La véritable histoire du plus grand groupe de tous les temps et de son époque.', 'oui', 566, '15,5 cm × 24,0 cm × 3,9 cm', ' Français', '978-2-262-07723-5', '9782262085520'),
	(6, 2, 5, 3, 'Scarlett Jo Hanson Mystère: Pelican Peak Island Livre 2', _binary , NULL, '2020-02-21 11:52:30', 'Scarlett a été affectée à l\'affaire Pelican Peak Island. De jeunes enfants atteints d\'une maladie en phase terminale sont kidnappés. Scarlett reçoit des indices du surnaturel pour résoudre l\'affaire. Peut-elle sauver les enfants? Que font-ils avec eux?', 'oui', 56, '12,0 cm × 18,0 cm × 1,2 cm', 'Français', '979-8-6125-0301-9', NULL),
	(7, 2, 6, 4, 'L\'homme le plus riche de Babylone', _binary , NULL, '2020-02-05 02:58:41', 'Votre bourse est bien mince et cela vous exaspère ? L\'Homme le plus riche de Babylone vous mène sur un chemin conduisant à la prospérité et au succès ! Joignez les millions de lecteurs qui se sont enrichis grâce aux conseils de ce livre renommé. Proclammé le meilleur livre parmi les oeuvres d\'inspiration', 'oui', 77, '15,3 x 1,2 x 22,9 cm', 'Français', '978-2892258400', '9782892258400'),
	(8, 2, 7, 5, 'Un papillon sur la braise', _binary , NULL, '2020-02-01 03:03:45', 'Jérémy est mort, voilà. Du fond de sa tombe, il contemple sa vie se jouer devant lui, comme un spectateur assistant à une représentation de théâtre. Ses amours, ses galères, ses folies, ses petits boulots… Sa déchéance, en somme. Une existence sans grande réussite, à laquelle il n’est pas parvenu à donner de sens. Mais la vie en a-t-elle véritablement un ? Dans ce roman surprenant, où l’ironie croise la philosophie, François Arnould décrit une existence ordinaire, presque minable, mais une existence vraie et authentique, car libérée des diktats imposés par notre monde qui vacille.', 'oui', 112, NULL, 'Français', '978-2-35523-231-2', '9782355232312'),
	(9, 2, 8, 6, 'Les Ombres du passé', _binary , NULL, '2020-02-23 03:07:39', 'Vingt ans après avoir fui sa ville natale en Virginie, Roy revient au pays pour veiller son père, atteint d\'un cancer incurable. Mais, en retournant au bercail, c\'est tout le passé traumatique de sa famille qui lui remonte soudainement au visage : le suicide de son frère en prison après qu\'il a tué les parents de sa petite amie, sa rupture avec Lila, son amour de jeunesse, qui ne s\'est jamais remise du drame...', 'oui', 216, '15,5 cm × 22,5 cm × 1,5 cm', 'Français', ' 978-2-3552-3230-5', '9782811217921'),
	(10, 3, 9, 7, 'Memoria', _binary , NULL, '2020-02-14 03:12:04', 'Dans un monde futuriste, la société de tourisme virtuel Brainstorm a mis sur pied une réplique du New York des années 1930 portant le nom de Memoria, une cité qui permet d\'assouvir tous les désirs. Mais un virus informatique incite à la révolte les personnages interactifs créés pour l\'amusement des humains...', 'oui', 127, '23,0 cm × 31,5 cm × 1,8 cm', 'Français', '978-2-89777-078-5', '9782897770785'),
	(11, 3, 10, 8, 'Je suis ton secret ', _binary , NULL, '2020-02-06 03:18:39', 'Des messages mystérieux apparaissent dans l\'agenda de Manah et ses amis du lycée n\'y sont pour rien. Non, ce n\'est pas une plaisanterie. Ces étranges messages prédisent l\'avenir, annoncent la mort de son meilleur ami, lui demandent de se rendre à des lieux précis... mais dans quel but ? Qui veut diriger ainsi la vie de Manah ? Doit-elle suivre ces instructions ? A-t-elle été choisie par hasard ? ...', 'oui', 48, '21,5 cm × 29,2 cm × 1,2 cm', 'Français', '978-2-35325-837-6', '9782353258376'),
	(12, 3, 11, 9, 'Mortelle Adèle', _binary , NULL, '2019-10-16 03:27:07', 'Embarquez pour une grande aventure au pays des Contes Défaits avec Mortelle Adèle ! "Les contes de fées, c\'est vraiment nazebroque ! Le premier lutin qui m\'approche avec ses paillettes magiques, je le catapulte dans l\'espace ! Et ces princes charmants là, avec leurs fées à tout faire, ils croient vraiment que les princesses ont encore besoin qu\'on les sauve ? ! Non mais sérieux, il est temps de dépoussiérer un peu tout ça ! " Mortelle Adèle se retrouve propulsée dans le pays des Contes Défaits, un monde merveilleux où tout le monde peut réaliser ses rêves ! Mais celle que tout le monde surnomme Princesse Barbecue traîne une réputation explosive qui détonne avec le calme apparent des habitants du Royaume d\'Enchantement...', 'oui', 112, '18,2 cm × 23,0 cm × 1,8 cm', 'français', '979-10-276-0774-7', '9791027607747'),
	(13, 3, 12, 10, 'Les p\'tits diables', _binary , NULL, '2015-11-04 03:30:46', 'La série best seller des frères et soeurs !Nina, la célébrissime pire des pires soeur et son non moins fameux frère Tom sont de retour pour un album tout en quiétude, paix et amour.VOUS NE ME CROYEZ PAS ???!Bon, vous avez raison, planquez vos vases, vos livres, vos meubles, votre chat, Tom et Nina sont à nouveau là et ça va bouger.', 'oui', 96, '21,5 cm × 30,0 cm × 2,0 cm', 'français', '978-2-302-04877-5', '9782302076884'),
	(14, 4, 13, 11, 'ma cuisine classique-fiction', _binary , NULL, '2019-11-21 03:37:03', 'Installé à Carcassonne depuis 20 ans, Franck Putelat est probablement le plus méditerranéen des jurassiens. A la tête de son restaurant Le Parc depuis 2006, le chef y propose une cuisine inventive qui exalte les produits de sa région d\'adoption. Bocuse d\'Argent en 2003 (le plus prestigieux concours international de cuisine), titulaire de deux étoiles au Michelin depuis 2012, ce cuisinier hors pair né en 1969 dirige également les cuisines des brasseries 4 temps à Carcassonne et à Tarbes, ainsi que celle du restaurant du musée de la romanité de Nîmes. Inlassable travailleur en quête du meilleur produit, il vient de remporter le concours de Meilleur Ouvrier de France. Spécialiste du " classique fiction " Franck Putelat montre sa maîtrise des classiques en les détournant pour mieux les magnifier. De superbes images du photographe Arnaud Späni viennent illustrer la cuisine graphique et colorée que Franck Putelat vous propose autour de vingt recettes, véritables chef-d\'oeuvre gustatifs et visuels.', 'oui', 102, '24,7 cm × 30,6 cm × 2,0 cm', 'français', '978-2-7089-4208-0', '9782708942080'),
	(15, 4, 14, 12, 'Le cinquième quartier', _binary , NULL, '2019-10-18 03:39:38', 'Le 5e quartier désigne les produits tripiers du boeuf, du veau, du porc et de l\'agneau. Vous trouverez ici plus de 40 façons modernes, joyeuses et appétantes de les cuisiner. La plume alerte, mi-Queneau, mi-San Antonio d\'Alain Demouchy, cuisinier, nous donne envie de nous mettre au fourneau là, tout de suite, après être allé faire son marché chez son tripier préféré. Pour ceux qui habitent non loin de Niort, ce sera bien sûr Pascal Gonnord ! Darri met en musique la portée d\'Alain avec des photos colorées et savoureuses.', 'oui', 128, '20,5 cm × 26,5 cm × 1,6 cm', 'français', '978-2-8177-0688-7', '9782817706887'),
	(16, 4, 15, 12, 'Meilleures ventes\r\nPremier âge (0-2 ans)\r\n', _binary , NULL, '2019-10-16 03:43:14', 'Quoi de plus alléchant pour végétaliser son alimentation que des recettes à la fois simples à préparer, savoureuses et nutritives ? Dans cet ouvrage, Linda Montpetit, nutritionniste gourmande, vous dévoile ses secrets culinaires. Découvrez comment vous régaler sainement et surprenez vos papilles ! Au menu : - Des conseils pour vous familiariser avec l\'alimentation végé : du choix des ingrédients aux combinaisons gagnantes de saveurs et de textures.', 'oui', 190, '20,2 cm × 24,6 cm × 1,8 cm', 'français', '978-2-89776-112-7', NULL),
	(17, 4, 16, 13, 'Gâteaux gourmands', _binary , NULL, '2020-01-28 03:47:37', 'Trop compliquée pour vous la pâtisserie ? Certainement pas ! Avec un minimum d\'ingrédients et en les choisissant bien, vous verrez qu\'il est possible de faire des miracles. D\'autant plus que le chocolat est un trésor de gourmandise et de subtilité qui se travaille avec amour. Cheesecake au spéculoos, mousse stracciatella, pumpkin cake, forêt noire, Paris-Brest, macarons à la fleur de set... Les recettes qui vous ont toujours fait rêver n\'auront plus aucun secret pour vous.', 'oui', 191, '14,0 cm × 18,0 cm × 1,0 cm', 'français', '979-10-323-0508-9', NULL),
	(18, 5, 17, 13, 'Reprendre sa vie en main', _binary , NULL, '2020-01-23 11:23:16', 'Reprendre sa vie en main... Oui c’est possible et plus facile que vous ne le croyez ! Car chacun a en soi le besoin inné de se réaliser, de construire quelque chose ou plus simplement de se construire. Prendre conscience de ce désir est le premier pas pour oser changer, et devenir l’artisan de son existence.', 'oui', 160, '10,8 cm × 17,8 cm × 0,8 cm', 'français', ' 978-2-2663-0061-2', '9782266300612'),
	(19, 5, 18, 13, 'Pour que chaque jour soit un bon jour', _binary , NULL, '2020-01-16 11:36:35', 'Le bonheur est un art de vivre. Furtif, il se loge dans ces petits riens qui sont tout. Ces petits riens qui se lovent partout et en vous, surtout. Adoptez des rituels, ils vous font la vie belle. Stella Delmas vous invite à un quotidien plus heureux. Réveillez la joie qui sommeille en vous. La vie est une danse, dansez-la à votre manière : singulière.', 'oui', 200, '12,0 cm × 18,0 cm × 1,6 cm', 'français', ' 978-2-2663-0618-8', '9782266306188'),
	(20, 5, 20, 14, 'La théorie de la veste', _binary , NULL, '2020-01-01 11:46:10', '« Je n’en peux plus de me trouver en rendez-vous avec des femmes plus belles, plus minces ou plus instruites que moi et qui ne croient pas en elles-mêmes. Je n’en peux plus de rencontrer des salariés qui n’osent pas demander de promotion ou d’augmentation, des entrepreneurs qui perfectionnent leur produit mais n’osent pas appeler leurs réseaux pour booster les ventes. Je n’en peux plus d’entendre certains parents dire à leurs enfants de " ne pas faire de vagues "…', 'oui', 220, '13,5 cm × 21,0 cm × 1,6 cm', 'français', '978-2-08-150025-9', '9782081500259'),
	(21, 5, 19, 15, 'Votre cerveau est définitivement extraordinaire', _binary , NULL, '2019-11-07 11:52:15', 'Le cerveau est extraordinaire, le vôtre particulièrement ! Mais saviez-vous qu\'il était facile d\'en utiliser toutes les ressources ? Qu\'il s\'agisse de multiplier 352 par 26 de tête, de négocier une augmentation ou de devenir un champion au poker : vous avez juste besoin d\'épanouir votre cerveau en utilisant les bonnes astuces. Car on n\'est jamais mieux servi que par son propre cerveau : voilà ce que Fabien Olicard défend et nous démontre à chaque page de ce nouvel ouvrage passionnant.', 'oui', 144, '12,0 cm × 18,0 cm × 1,2 cm', 'français', '978-2-266-29291-7', '9782266292917'),
	(22, 6, 21, 16, 'Parlez-vous (les) français ? Atlas des expressions de nos régions', _binary , NULL, '2019-10-09 12:00:29', 'D’un bout à l’autre de la francophonie d’Europe (Belgique, France et Suisse), les expressions utilisées pour se saluer, se réjouir, râler ou parler du temps qu’il fait ne sont pas toujours les mêmes. La richesse du français de nos régions s’illustre', 'oui', 128, '22 x 19 x 1 cm', 'français', '978-2-200-62340-1', '9782200623401'),
	(23, 6, 22, 12, 'Encore plus de bonbons sur la langue', _binary , NULL, '2019-09-03 12:03:39', 'Amis des mots, phobiques de l\'orthographe et amateurs de la langue de Molière vont se frotter les mains : Muriel Gilbert est de retour avec un livre malin, ludique et désopilant pour tous les amoureux du français. En une centaine de chroniques, la plus célèbre des correctrices distille ses petits conseils et déchiffre les excentricités de notre langue. Elle tente par exemple de nous réconcilier avec la ponctuation, fait le point sur ce qu\'on appelle les signes diacritiques, ou lève le voile sur les mystères de l\'impératif.', 'oui', 217, '14,0 cm × 21,0 cm × 1,8 cm', 'français', '978-2-311-10279-6', '9782311102796'),
	(24, 6, 23, 15, 'Coffret Argot Anglais/Americain', _binary , NULL, '2019-08-22 12:08:07', 'Celui qui maîtrise l\'argot dans une langue peut prétendre bien la connaître : c\'est la partie la plus vivante et la plus intime de celle-ci. Et puis c\'est très utile pour décoder séries et chansons de rap préférées. Voici deux manuels de référence amusants présentant de très nombreux exemples de slang anglais et américain, réunis pour la première fois sous coffret.', 'oui', 150, '10,0 cm × 14,0 cm × 1,5 cm', 'français', '978-2-7005-0851-2', '9782700508512'),
	(25, 6, 24, 12, 'Bescherelle La grammaire pour tous', _binary , NULL, '2019-06-19 12:12:02', 'Une grammaire de référence, accessible à tous. Pour comprendre le fonctionnement de la langue française et mieux la maîtriser. Une grammaire pratique, accessible à tous Destiné à tous ceux qui s\'intéressent au fonctionnement du français - lycéens, étudiants, enseignants ou amoureux de langue française -, l\'ouvrage contient : - des explications claires, - plus de 1 000 exemples commentés, - des tableaux récapitulatifs, - des conseils d\'orthographe et d\'expression.', 'oui', 320, '13,5 cm × 19,0 cm × 1,9 cm', 'français', '978-2-401-05236-9', ' 9782401052369'),
	(26, 7, 25, 12, 'Le secret néolibéral', _binary , NULL, '2020-02-13 12:16:37', 'Quarante ans révolus après ses débuts, l\'expérience libérale engagée dans les années 1980 demeure une énigme. Le débat qui l\'entoure, limité à ses partisans et ses détracteurs, méconnaît la genèse et la nature de cette expérience. Ils sont d\'accord, en fait, pour y voir un retour aux sources du capitalisme, célébré par les uns et combattu par les autres. Or, c\'est au contraire un capitalisme très différent de son modèle originel qui s\'est inventé à cette occasion, montre Jean-Luc Gréau.', 'oui', 160, '14,0 cm × 20,5 cm × 1,2 cm', 'français', '978-2-07-288061-2', '9782072880612'),
	(27, 7, 26, 15, 'Le juge d\'instruction', _binary , NULL, '2020-02-12 12:19:27', 'Véritable Janus du monde judiciaire, le juge d\'instruction présente un double visage. Son ambivalence puise sa source dans sa propre définition : en effet, s\'il dispose de pouvoirs préjudiciables aux libertés, il représente, par son existence même, une garantie fondamentale en tant que magistrat dont l\'indépendance à l\'égard du pouvoir exécutif est assurée par la Constitution. Renaud Van Ruymbeke offre une description et une explication claires de la place qu\'a, au sein de l\'édifice judiciaire, ce personnage aussi connu que méconnu, et de ses pouvoirs sur les individus, les biens et les procédures.', 'oui', 128, '11,5 cm × 17,5 cm × 1,0 cm', 'français', '978-2-7154-0276-8', '9782715402768'),
	(28, 7, 27, 15, 'La liberté, ça marche !', _binary , NULL, '2020-08-01 12:24:05', 'Depuis quelques années, les entreprises libérées se multiplient dans le monde entier. Leur particularité ? Les salariés, responsabilisés et autonomes, s\'autodirigent. Et les résultats font rêver : confiance et liberté d\'initiative se traduisent par l\'épanouissement de tous au travail et des performances spectaculaires... Pour guider tous les leaders en herbe intéressés par la libération, qu\'ils soient chefs d\'entreprise ou non, ce livre propose une sélection de textes, pour la plupart introuvables en France, commentés par le plus grand spécialiste du domaine.', 'oui', 384, '10,9 cm × 17,8 cm × 1,7 cm', 'français', '978-2-08-142253-7', '9782081422537'),
	(29, 7, 28, 12, 'Droit administratif', _binary , NULL, '2019-11-06 12:27:58', 'Le droit administratif regroupe l\'ensemble des règles spécifiques applicables à l\'organisation et à l\'action de l\'administration, ainsi qu\'à son contrôle. Discipline complexe, le droit administratif ne cesse d\'évoluer dans le sens d\'une protection plus effective des droits des administrés, par l\'oeuvre de la loi relayée par la jurisprudence tant nationale que communautaire. Ouvrage reconnu, cet HyperCours offre un cours complet et conforme aux besoins des étudiants ainsi que des compléments pédagogiques de qualité permettant une bonne préparation aux épreuves de TD, d\'examens universitaires mais aussi de concours administratifs.', 'oui', 700, '19,0 cm × 24,0 cm × 2,6 cm', 'français', '978-2-247-18920-5', '9782247189205'),
	(30, 8, 29, 15, 'Maman, ne me laisse pas m\'endormir', _binary , NULL, '2020-12-13 12:30:41', '« Je vis chaque minute de cette nuit-là à sa place. Il était seul, toutes ces heures. […] J’aurais pu le serrer, le rassurer, l’apaiser […]. J’aurais pu lui ôter sa peur, la rendre acceptable […]. Je n’étais pas là. »', 'oui', 160, '11,0 cm × 17,8 cm × 1,0 cm', 'français', '978-2-290-20054-4', '9782290200544'),
	(31, 8, 30, 12, 'La révolte d\'une interne', _binary , NULL, '2018-10-25 12:34:13', 'Lorsqu\'il nous est impossible de répondre à un appel à l\'aide, à des yeux quémandeurs, à une colère qui n\'aurait besoin que de douceur pour s\'éteindre, c\'est une petite partie de nous qui se désintègre, une parcelle de peau de soignant, infime, qui se désagrège. La blouse n\'est pas une armure. Elle ne le devient jamais. 11 janvier 2017. Sabrina-Aurore Ali Benali, jeune interne dans un service d\'urgence, interpelle sur sa page Facebook "Sabrina Aurora" la ministre de la Santé sur l\'état alarmant de l\'hôpital en France.', 'oui', 176, '14,0 cm × 22,0 cm × 1,5 cm', 'français', '978-2-7491-5750-4', '9782749157504'),
	(32, 8, 31, 17, 'Vite !', _binary , NULL, '2020-02-06 12:36:36', 'Tout va trop vite dans cette société qui célèbre l’instant aussi intensément qu’elle l’oublie. Il faut aller vite, gagner du temps, ne pas en perdre, chasser les temps morts, ne plus attendre. La vitesse impose une accélération de nos modes de vie de plus en plus déstabilisante. Politique, économie, entreprise, société, médias, relations humaines : nous ne vivons plus que dans l’instant avec la sensation d’être toujours dépassé, soumis au diktat de l’immédiateté. Réformes rapides et temps court valorisé au profit du temps long en politique ; prise de décisions économiques sous la contrainte de l’instant au risque supposé d’effondrement du système mondial ; triomphe des grandes entreprises qui placent la lutte contre le temps au cœur de leur modèle de développement ; pression constante de l’urgence et de la vitesse en entreprise devenue la norme ; médias et réseaux sociaux vivant beaucoup dans le culte de l’instant ; relations humaines toujours plus expéditives symbolisées par les messageries instantanées et les sites de rencontres ; identités troublées par cette vitesse faute de pouvoir se construire dans la continuité sur le temps long.', 'non', 352, '21 x 14 x 3 cm', 'français', '978-2-2592-7775-4', '9782259277754'),
	(33, 9, 32, 12, 'La copropriété: Les droits et devoirs du copropriétaire, du syndic et de la copropriété', _binary , NULL, '2019-11-12 12:47:49', 'Il y a, en Belgique, près d\'un million et demi d\'appartements. La majorité d\'entre eux sont situés dans des immeubles en copropriété. Or, la plupart des gens qui y vivent ignorent les règles qui gouvernent ce type d\'habitat groupé : quelles sont les obligations du syndic, comment fonctionne l\'assemblée générale, comment est-elle convoquée et comment délibère-t-elle, quels sont les recours contre ses décisions, etc ? Et on constate que si les procès en matière de copropriété sont nombreux, beaucoup auraient été évités si, simplement, les règles avaient été suivies.', 'oui', 216, '13,0 cm × 19,0 cm × 1,5 cm', 'français', '978-2-8079-1773-6', '9782807917736'),
	(34, 9, 33, 18, 'Préparer et réussir le concours VTC', _binary , NULL, '2019-12-20 12:50:03', 'La nouvelle version 2020 de "Préparer et réussir le concours VTC" est un manuel précis et exhaustif qui fait découvrir la profession de VTC ainsi que les différents aspects du métier de "VTC" (Voiture de Transport avec Chauffeur) et permet de préparer au mieux l\'examen préfectoral pour l\'obtention de la carte professionnelle de chauffeur VTC. Il inclut la mise à jour de toutes les règles légales et conditions d\'accès à la profession VTC pour 2020, ainsi que les conditions de son exercice.', 'oui', 250, '17,0 cm × 24,0 cm × 0,2 cm', 'français', '978-2-7191-1082-9', '9782719110829'),
	(35, 9, 34, 19, 'Cette année, je fais tout moi-même', _binary , NULL, '2019-10-10 12:52:58', 'Le Bullet Journal du tout faire soi-même pour se chouchouter et prendre soin de la planète au quotidien. Tout ce qu\'il faut pour une année pleine de surprises et de conseils green ! Pour celles qui manquent de temps mais pas d\'entrain, le Bullet Journal prêt-à-l\'emploi et... #YAPLUKA ! Un agenda perpétuel, un jour par page, avec des illustrations "mood board" et de nombreuses rubriques green spirit.', 'oui', 468, '19,2 cm × 25,1 cm × 4,1 cm', 'français', '979-10-301-0232-1', '9791030102321'),
	(36, 9, 3, 20, 'Je Pars Vivre en Australie', _binary , NULL, '2020-01-27 12:55:16', 'Uluru (Ayers Rock), monolithe mythique au coeur de l outback, symbolise à lui seul l Australie : une île-continent, impressionnante par sa taille (deux fois l Europe) et ses contrastes. Du bush à l Opéra de Sydney, de la Grande Barrière de corail aux cafés de Melbourne, des vignobles de la Barrossa Valley aux diables de Tasmanie, la terre des Aborigènes est devenue aujourd hui le pays de la chance, arborant un taux de chômage quasi nul et le record de la plus longue période de croissance (plus de 20 ans). Portant le rêve de tout migrant backpacker attiré par les grands espaces, professionnel motivé par un plan de carrière, jeune conquis par le working holiday visa (WHV) et l idée du Wwoofing... , elle attire chaque année plus de 200 000 Français. Ne manquez pas l appel de ce nouveau monde, certainement le meilleur coin de la planète. L Australian way of life s offre à vous !', 'oui', 55, NULL, 'français', '979-10-94735-15-2', '9791094735152'),
	(37, 8, 32, 21, 'Bernie Sanders: Quand la gauche se réveille aux états unis', _binary , NULL, '2020-02-06 13:04:47', NULL, 'non', 386, NULL, 'français', '978-2-3609-3073-9', NULL);
INSERT INTO `livre` (`idLivre`, `idCategorie`, `idAuteur`, `idEditeur`, `nom`, `image`, `enSavoirPlus`, `dateDePublication`, `description`, `disponible`, `nbDePage`, `dimension`, `langue`, `isbn`, `ean`) VALUES
	(38, 10, 36, 15, 'Les mannequins nus', _binary , NULL, '2020-02-13 13:16:14', 'Des femmes sans nom, sans vêtements, le crâne rasé. Des objets. Des mannequins nus. Dans l\'enfer d\'Auschwitz, les femmes déportées ont connu les conditions de vie inhumaines, la violence des gardes, mais aussi l\'entraide et la résistance. Rassemblant des témoignages de rescapées, Christian Bernadac retrace le quotidien de ces femmes prisonnières à travers les histoires de Mala, Danielle, Regina et toutes ces autres, anonymes ou non, qui livrent ici un chapitre essentiel de l\'Histoire.', 'oui', 397, '10,9 cm × 17,8 cm × 1,8 cm', 'français', '979-10-224-0392-4', '9791022403924'),
	(39, 10, 37, 12, 'Dictionnaire amoureux du Général', _binary , NULL, '2020-02-06 13:22:32', 'Aventurier shakespearien aux prises avec des ennemis innombrables, de Gaulle a imaginé le roman de sa vie, et l\'a imposé sur le théâtre tragique de l\'Histoire en amoureux d\'une France qui aujourd\'hui encore lui doit presque tout. Il fut un héros aux frontières de la folie. Un chef de guerre longtemps seul contre tous. Un homme d\'Etat visionnaire dans la lignée de Richelieu. Un écrivain dans le sillage de Chateaubriand.', 'oui', 460, '13,2 cm × 20,0 cm × 2,5 cm', 'français', '978-2-259-26474-7', '9782259264747'),
	(40, 10, 38, 22, 'La bataille des Ardennes - Hiver 1944-1945', _binary , NULL, '2016-05-16 13:25:01', 'La bataille des Ardennes est le nom donné à l\'ensemble des opérations militaires qui se sont déroulées en Ardenne durant l\'hiver 1944-1945. Tout commence le 16 décembre 1944, par l\'offensive surprise de l\'armée allemande appelée Offensive von Rundstedt. Hitler a pour objectif de briser les forces alliées. Mais il a sous-estimé la détermination des troupes américaines, et la bataille des Ardennes n\'aura pas le résultat escompté : elle prend fin en janvier 1945 après le refoulement des Allemands au-delà de leur ligne de départ.', 'oui', 176, '16,0 cm × 23,0 cm × 1,2 cm', 'français', '978-2-8138-0942-1', '9782813809421'),
	(41, 10, 39, 2, 'Von Rundstedt - Le maréchal oublié', _binary , NULL, '2020-02-06 13:37:58', 'Son nom apparaît dans tous les livres ayant trait à la Seconde Guerre mondiale, pourtant il est sans doute le moins connu des meilleurs généraux de la Wehrmacht. Gerd von Rundstedt (1875-1953). aristocrate prussien, ancien combattant de la Grande Guerre et doyen des forces armées allemandes, prit part aux principales campagnes européennes du conflit, à la fois comme concepteur et exécutant des plans d\'invasion : la Pologne en 1939.', 'oui', 396, '14,0 cm × 21,0 cm × 3,2 cm', 'français', '978-2-262-04321-6', '9782262043216'),
	(42, 11, 40, 23, 'Divorcée et joyeuse', _binary , NULL, '2019-11-07 13:45:09', 'Vous vous êtes séparée de l\'ex-amour de votre vie, et votre existence se trouve soudain complètement chamboulée. Vous ne le savez pas encore mais le divorce peut être l\'occasion d\'une véritable renaissance. Après le chantier, la reconstruction ; après les larmes, le sourire ; après l\'angoisse, la sérénité ; après le désespoir, le plaisir ! La rupture amoureuse peut vous permettre de renouer avec une personne formidable que vous aviez perdue de vue : vous-même.', 'oui', 158, '16,5 cm × 20,0 cm × 1,0 cm', 'français', '978-2-7491-6219-5', '9782749162195'),
	(43, 11, 41, 24, 'Petit livre - Tu connais la différence entre...', _binary , NULL, '2019-11-21 13:47:50', 'Le petit livre d\'humour avec plus de 150 devinettes hilarantes ! Tu connais la différence entre un bouchon de champagne et un enfant ? Le bouchon de champagne porte le nom du fabricant... Tu connais la différence entre le temps et un oeuf ? Le temps passe mais l\'oeuf dur... Tu connais la différence entre le pouce et le majeur ? Essaye donc de faire du stop avec le majeur !', 'oui', 160, '8,5 cm × 12,0 cm × 0,8 cm', 'français', '978-2-412-04483-4', '9782412044834'),
	(44, 11, 42, 14, 'Atlas Gorafi des régions', _binary , NULL, '2019-11-06 13:50:16', 'Tout, selon des sources contradictoires, sur toutes ces régions françaises où de toute façon vous ne mettrez jamais les pieds. Des lieux à visiter Ou à éviter, testés et approuvés par nos rédacteurs, guidés par " des gens du coin ", des dizaines d\'idées de sorties pour penser à autre chose qu\'à la mort et éviter à ce livre de finir au pilon. " Que faire ? " Découvrez tout ce que vous pourriez faire si par accident vous vous retrouviez coincé un dimanche après-midi là-bas.', 'oui', 189, '16,3 cm × 22,5 cm × 1,8 cm', 'français', '978-2-08-148913-4', '9782081489134'),
	(45, 11, 3, 61, 'Les meilleures blagues : Le best of', _binary , NULL, '2019-10-31 13:52:58', 'Tout vous casse les pieds et vous n\'avez plus le moral ? La solution miracle, vous l\'avez entre les mains : près de 1000 blagues pour enfin retrouver le sourire et partager des heures de franche rigolade avec vos proches. De la blague la plus légère à la plus grossière, de la petite devinette aux histoires de Toto, vous en aurez pour tous les goûts.', 'oui', 160, '14,7 cm × 20,5 cm × 0,9 cm', 'français', '978-2-8226-0694-3', '9782822606943'),
	(46, 12, 46, 24, 'La cybersecurité pour les nuls', _binary , NULL, '2020-01-30 16:45:15', 'La cybersécurité à portée de tous ! Connaissez-vous les cybermenaces les plus courantes ? Savez-vous comment vous défendre ? Que faire si vos informations personnelles ou professionnelles sont mises en danger ? Ce livre vous donne, dans un langage simple et clair, toutes les informations nécessaires à la protection de vos systèmes informatiques. Après une présentation des types de menaces qui vous guettent et de la manière dont elles opèrent, vous apprendrez à les localiser et à les neutraliser.', 'oui', 415, '19,0 cm × 23,2 cm × 2,5 cm', 'français', '978-2-412-05074-3', '9782412050743'),
	(47, 12, 44, 25, 'Les réseaux sociaux pour les nuls', _binary , NULL, '2020-01-30 16:48:18', 'Plongez avec bonheur dans l\'océan des réseaux sociaux ! Cet ouvrage est destiné à tous ceux qui souhaitent débuter ou renforcer leur présence sur les réseaux sociaux. Il couvre en particulier les différentes facettes du plus célèbre d\'entre eux, Facebook, mais pas seulement : les principaux réseaux sociaux, généralistes et spécialisés, amicaux ou professionnels, y sont abordés, comme Twitter, Snapchat, Linkedln, Instagram ou YouTube.', 'oui', 408, '19,0 cm × 23,1 cm × 2,4 cm', 'français', '978-2-412-05318-8', '9782412053188'),
	(48, 12, 45, 62, 'HTML5 et CSS3 - Faites évoluer le design de vos sites web', _binary , NULL, '2019-04-10 16:50:32', 'Pour les designers web, la conception des sites web passe par la maîtrise des langages fondateurs que sont l\'HTML (HyperText Markup Language) et les CSS (Cascading Style Sheets). Les dernières versions de ces deux langages, l\'HTML5 et les CSS3, vont faire évoluer la manière de concevoir vos sites web en vous offrant de nouvelles possibilités de structure, de mise en page et de mise en forme. Ce livre s\'adresse aux concepteurs de sites web et aux designers web ayant déjà la connaissance de l\'HTML 4 et des CSS 2.1, qui veulent faire évoluer leurs créations et créer des sites web intégrant ces nouveaux standards.', 'oui', 448, '17,5 cm × 21,0 cm × 2,2 cm', 'français', '978-2-409-01851-0', '9782409018510'),
	(49, 12, 43, 25, 'Photoshop Elements pour les nuls', _binary , NULL, '2019-01-31 16:53:04', 'Pour enfin tout savoir sur le petit frère de Photoshop, Elements 2019 ! Photoshop Elements 2019 est la nouvelle version du logiciel de retouche d\'images grand public par excellence. Avec ce livre en mains, vous apprendrez à créer des diaporamas, à optimiser vos images pour le Web, ou à redonner une nouvelle jeunesse à vos vieilles photographies. Vous allez découvrir également toutes les nouveautés apportées par la version 2019 comme l\'application d\'effets de peinture en quelques clics à l\'intérieur de vos photos, les assistants qui vous guident dans la création d\'effets spéciaux, les nouveaux outils texte, la correction automatique de photos, et bien d\'autres choses encore.', 'oui', 300, NULL, 'français', '978-2-412-04672-2', '9782412046722'),
	(50, 13, 49, 26, 'Skye et le vieux solitaire', _binary , NULL, '2020-02-13 22:37:18', 'Par-delà les mers et surgissant de la brume se trouve l\'archipel des Confins. Ses habitants sont vireurs de nuages, chevaucheurs de vent... et chasseurs de foudre, le rêve de Skye ! Mais, depuis que son père (qui est aussi le meilleur chasseur, tonnerre de brume ! ) a eu un accident lui ayant fait perdre la raison, la jeune intrépide a renoncé à son rêve. Lorsqu\'un jour la mer engloutit les Iles Basses, les îliens, habitués des fortes tempêtes, n\'y prêtent guère attention.', 'oui', 173, '14,0 cm × 22,0 cm × 1,5 cm', 'français', '978-2-35488-770-4', '9782354887704'),
	(51, 13, 48, 27, 'Wilder Girls', _binary , NULL, '2020-02-13 22:39:59', 'Une île sauvage, trois amies inséparables, une descente aux enfers. Voilà bientôt dix-huit mois qu\'un mal inconnu, la Tox, a frappé l\'île Raxter. Dix-huit mois que le pensionnat pour jeunes filles qui en occupe la pointe a été mis sous quarantaine. D\'abord, la Tox a tué les enseignantes, une à une, puis elle a infecté les élèves, dont les survivantes portent désormais ses monstrueux stigmates dans leur chair.', 'oui', 443, '13,5 cm × 21,5 cm × 3,0 cm', 'français', '978-2-221-24678-8', '9782221246788'),
	(52, 13, 47, 28, 'Akata Witch', _binary , '', '2020-02-12 00:00:00', 'Mon nom est Sunny Nwazue et je perturbe les gens. Je suis Nigériane de sang, Américaine de naissance et albinos de peau. Contrairement au reste de ma famille, j\'ai des cheveux jaune paille, la peau couleur " lait tourné " et des yeux noisette. Etre albinos fait du soleil mon ennemi. Ma peau brûle tellement vite que j\'ai parfois l\'impression d\'être inflammable. C\'est pour ça que je n\'ai jamais pu jouer au foot, alors que je suis douée.', 'non', 368, '15,0 cm × 21,7 cm × 2,8 cm', 'français', '978-2-211-30434-4', '9782211304344'),
	(53, 13, 3, 29, 'Les Animaux de la Ferme', _binary , NULL, '2020-02-11 22:46:27', NULL, 'oui', NULL, NULL, 'français', ' 978-9-4637-8955-4', NULL),
	(54, 15, 54, 30, 'Le plus beau des cadeaux - Le miracle de Noël - Un bébé pour le réveillon - Des fêtes inoubliables', _binary , NULL, '2019-12-01 22:56:04', 'Le miracle de Noël, Sarah MorganAprès les épreuves qui ont entouré la naissance de sa fille Grace, Tiffany vit comme un merveilleux cadeau son idylle avec Dan Donovan, le pédiatre de l\'hôpital où elle travaille. Mais un malaise la gagne quand elle comprend qu\'elle va devoir lui avouer son secret d\'ici les fêtes de Noël, si elle espère nouer une véritable relation avec lui.  Un bébé pour le réveillon, Ann MajorQuand elle découvre qu\'elle est enceinte de Léo Storm, avec lequel elle n\'a passé qu\'une nuit, Abby décide de lui dire la vérité.', 'oui', 416, NULL, 'français', '978-2-280-43976-3', '9782280439763'),
	(55, 15, 53, 31, 'Sélection Sexy summer - Carrément in love & Carrément dingue de toi ', _binary , NULL, '2019-06-05 22:58:08', 'Carrément in Love. Pilote de stock-car émérite, Kendall Holbrook vient de faire son entrée aux Cup Series, l\'un des plus grands tournois automobiles. Déterminée à prouver qu\'une femme peut s\'épanouir et évoluer dans un univers exclusivement masculin, elle a peu de temps pour l\'amour. Le retour dans sa vie d\'Evan Monroe sera-t-il un nouveau départ ? Carrément dingue de toi. Malgré deux ans de séparation, Suzanne découvre que son divorce avec Ryder n\'a jamais été prononcé.', 'oui', 629, '11,1 cm × 17,8 cm × 2,8 cm', 'français', '978-2-290-19390-7', '9782290193907'),
	(56, 15, 52, 32, 'L\'année du pardon', _binary , NULL, '2020-01-15 23:00:09', 'A la mort de leur mère, les trois soeurs Violet, Rose et Fleur Parker pensaient qu\'elles allaient hériter de la maison familiale. Mais leur mère leur a réservé une surprise : si elles veulent effectivement en hériter, elles vont devoir passer ensemble les week-ends de l\'année à venir, tout en réalisant une liste d\'activités. Les trois soeurs sont très différentes et ne s\'apprécient pas franchement, estimant n\'avoir rien en commun.', 'oui', 368, '11,1 cm × 17,8 cm × 1,7 cm', 'français', '978-2-8246-1631-5', '9782824616315'),
	(57, 15, 51, 30, 'Heureux événements - Inavouable tentation ; Quand l\'amour sonne à la porte ; Au nom de son fils', _binary , NULL, '2020-02-01 23:02:59', 'Il n\'est pas toujours facile de trouver l\'amour lorsqu\'on élève un enfant... Inavouable tentation Il y a deux ans, Sara a pris soin de Jase quand, grièvement blessé, il en avait le plus besoin. C\'est Jase qui vole aujourd\'hui à son secours : il les hébergera, sa fille et elle, le temps qu\'il faudra. Toutefois, comme ils ne vont pas tarder à le découvrir, vivre aussi près de la personne que l\'on désire en secret peut devenir un supplice...', 'oui', 560, '10,8 cm × 17,8 cm × 3,3 cm', 'français', '978-2-280-43329-7', '9782280433297'),
	(58, 14, 55, 6, 'Quand Dieu boxait en amateur', _binary , NULL, '2020-02-13 23:15:06', '"Il faut l\'imaginer, mon père ce héros, roi du monde et boxeur, assis dans la cuisine, ouvrir son dictionnaire et recopier des mots dont il se demande comment il parviendrait à les tordre sous sa langue pour construire des phrases aussi belles et volubiles que les fers emmêlés qu\'il façonne dans son atelier". Dans une France rurale oubliée, un gamin passionné par les mots grandit auprès d\'une mère que la littérature effraie.', 'oui', 192, '11,0 cm × 17,8 cm × 1,2 cm', 'français', '978-2-07-283575-9', '9782072835759'),
	(59, 14, 57, 6, 'Le coeur converti', _binary , NULL, '2020-02-13 23:18:15', '"Je voudrais pouvoir la mettre en garde contre ce qui va lui arriver. Passe ton chemin, jeune fille, choisis un autre homme, échappe à ce sort, fuis ce qui t\'attire." Par amour pour David, la belle Vigdis renonce à ses privilèges de jeune noble chrétienne et se convertit au judaïsme. Mais en ce début de XIe siècle en France, leur union fait scandale. Pour vivre librement, tous deux s\'enfuient et trouvent refuge dans un village du Sud.', 'oui', 416, '11,0 cm × 17,8 cm × 1,7 cm', 'français', '978-2-07-287365-2', '9782072873652'),
	(60, 14, 58, 12, 'Tout commence par la baleine ', _binary , NULL, '2020-02-13 23:20:16', 'Alors que son grand-père roumain vient de mourir, Alba, Finlandaise qui vit à Helsinki, se remémore ses étés passés dans un petit village près de la frontière serbe. Les odeurs, les couleurs, la lumière du jour, un ciel étoilé sont autant de sensations liées à un lieu, une période, une personne. Ses souvenirs sont aussi assombris par des secrets et des cicatrices qui datent de l\'époque de la dictature de Ceausescu.', 'oui', 319, '13,5 cm × 21,5 cm × 2,7 cm', 'français', '978-2-221-22171-6', '9782221221716'),
	(61, 14, 56, 33, 'La première amie', _binary , NULL, '2020-02-13 23:22:37', 'Inséparables depuis leur enfance d\'orphelines, malgré leurs tempéraments opposés, leurs choix de vie, ou leurs maris. Eve, la sage, est depuis toujours fascinée, attirée comme un aimant, par la magnétique Sarah. Leur amitié si particulière, grandie au fil de l\'eau d\'un canal de l\'Est, intrigue tous leurs proches. Une tragédie et un secret scelleront leur destin pour toujours... Il y a des êtres faits de pure beauté.', 'non', 264, NULL, 'français', '978-2-258-16329-4', '9782258163294'),
	(62, 16, 62, 34, 'Les indomptables - Arrêtez des suivre le troupeau', _binary , NULL, '2020-02-25 23:39:37', 'Trois femmes, trois choix, un monde de jugement. Tara, Cam et Stella ne se connaissent pas. Pourtant, dans notre société qui définit des attentes précises pour les femmes, des liens invisibles se créent. L\'ambitieuse Tara veut briser le plafond de verre dans un milieu professionnel dominé par les hommes ; la blogueuse féministe Cam assume complètement son choix de ne pas vouloir d\'enfants ; la délicate Stella doit choisir entre avoir des enfants ou continuer à vivre.', 'oui', 310, '14,6 cm × 23,0 cm × 3,2 cm', 'français', '978-2-36812-513-7', '9782368125137'),
	(63, 16, 61, 6, 'Du rififi à Wall Street', _binary , NULL, '2020-02-13 23:42:01', 'Un soir de février, Eisinger reçoit un appel de son agente : la directrice des relations publiques du groupe Black lui propose d\'écrire l\'histoire de cette entreprise de télécommunications du Midwest. Vlad accepte à condition d\'en faire plus qu\'un ouvrage documentaire, plutôt une sorte de légende de Tar, le patron très charismatique du groupe. Quelques semaines après le début du projet, Tar stoppe tout et renvoie Vlad.', 'oui', 308, '14,0 cm × 20,5 cm × 2,1 cm', 'français', '978-2-07-285944-1', '9782072859441'),
	(64, 16, 60, 6, 'La cité des chacals', _binary , NULL, '2020-02-13 23:45:10', 'Le filet d\'un pêcheur sur le Nil a remonté une tête coupée. A en juger par les scarifications sur le front, c\'est celle d\'un Dinka de la région de Bor : un Soudanais du Sud. Encore un réfugié, pense la police cairote qui s\'en désintéresse. Car ils sont plus de deux mille, entassés sur une place de Mohandessin, qui se plaignent de leurs conditions de vie. Ici, le roman rejoint l\'Histoire : on est en 2005, à la veille des émeutes de décembre.', 'oui', 464, '14,0 cm × 20,5 cm × 3,0 cm', 'français', '978-2-07-282872-0', '9782072828720'),
	(65, 16, 59, 35, 'Sois gentil, tue-le', _binary , NULL, '2020-02-15 23:47:01', 'La mer, elle est partout. Et parfois, au milieu, il y a des îles. Pascal et Murène sont des insulaires mais pas de la même île. Lui, c\'est une île de l\'océan, et elle, une de Méditerranée. Ensemble, ils pêchent sur un chalutier. Le Mort, il s\'appelle. Dessus, ballotés par les vagues et les tempêtes, ils vont bien ensemble. Mais à terre, avec leur passé à traîner, c\'est pas facile tous les jours...', 'oui', 152, '12,5 cm × 19,0 cm × 1,3 cm', 'français', '978-2-37722-088-5', '9782377220885'),
	(66, 17, 3, 36, 'Les miracles de Saint Benoît - Miracula sancti Benedicti', _binary , NULL, '2019-12-03 00:07:42', 'Rédigés entre le IXe et le XIIe siècle par cinq auteurs, tous moines de Fleury, les neuf livres des Miracula sancti Benedicti, relatent les miracles survenus auprès des reliques de saint Benoît, tant à Fleury qu\'en différents lieux dépendants du monastère. Ces reliques qui reposaient au Mont Cassin, ont été déposées à Fleury au VIIe siècle, comme le rappelle l\' Historia translationis, introduction indispensable du recueil.', 'non', 648, NULL, 'français', '978-2-2711-2970-3', NULL),
	(67, 17, 64, 37, 'Qui es-tu pour m\'empêcher de mourir ? ', _binary , NULL, '2020-01-23 00:11:03', '"Mais qui es-tu pour m\'empêcher de mourir ? " Cette question cinglante fut posée à l\'auteur par un homme en détresse. Elle traduit le contenu et l\'esprit de ces chroniques écrites du quotidien. Gilles Rebêche y raconte sa vocation de diacre à Toulon et dans l\'ensemble du département du Var. En plus de quarante histoires pétillantes où affleurent joies, grandeurs et souffrances des personnes qui subissent ta pauvreté, il révèle son itinéraire au service des "sans voix" dans la rue, dans les cités, auprès des responsables politiques.', 'oui', 217, '15,6 cm × 21,8 cm × 1,7 cm', 'français', '978-2-7082-4628-7', '9782708246287'),
	(68, 17, 63, 38, 'Amis de l\'Epoux - Pour une vision renouvelée du célibat sacerdotal', _binary , NULL, '2019-03-12 00:13:04', 'Les prêtres et les évêques vivent de nos jours un temps d\'épreuve et même de crise, mais ce temps difficile peut devenir une opportunité de conversion et de croissance. Avec la grâce de Dieu et la volonté de mieux répondre à Sa Parole. Les scandales, les humiliations et l\'usure de ces dernières années ont précipité le haut et bas clergé dans un état de vulnérabilité, sinon de désarroi, qu\'on reconnaît à des signes de fatigue, de tensions, et même de découragement, jusqu\'à des gestes inconsidérés.', 'oui', 256, '13,8 cm × 22,4 cm × 1,9 cm', 'français', '978-2-88959-138-1', '9782889591381'),
	(69, 17, 65, 39, 'D\'un pas à l\'autre : Accompagner les pas du quotidien', _binary , NULL, '2020-01-19 00:16:33', 'Accompagner les pas du quotidien en offrant aux lecteurs un petit livre facile à transporter et dans lequel ils pourront puiser une parole pour soutenir leur méditation journalière, tel est le but de cet ouvrage. A une époque où l\'emploi du temps ne permet plus forcément de consacrer de longues plages à la lecture, il est peut-être bienvenu d\'offrir pour chaque jour deux textes à la fois denses et courts qui se font écho, l\'un de Francine Carrillo et l\'autre d\'un auteur spirituel, écrivain ou philosophe, qui se démarquent un peu de toute la littérature du prêt-à-porter spirituel et des recettes de bien-être, si largement représentées dans les médias aujourd\'hui. On trouvera ici un croisement de plusieurs perspectives : biblique, éthique, poétique ou tout simplement humaine, qui devraient pouvoir atteindre un public en recherche d\'une spiritualité exigeante et réfléchie, mais aussi " légère " !', 'oui', 215, NULL, 'français', '978-2-7122-1540-8', NULL),
	(70, 18, 69, 31, 'Les pouvoirs cachés du foie - Gagnez des années de vie en bonne santé !', _binary , NULL, '2020-01-15 00:24:36', 'Le foie, le plus volumineux de nos organes, est aussi le plus négligé. Dommage, car c\'est avant tout grâce à lui que nous pouvons vivre plus longtemps, et surtout... en bonne santé ! Véritable superhéros multitâche, il est d\'autant plus facile à protéger qu\'il dispose d\'une capacité unique à se régénérer. Il suffit de savoir l\'aider... Comment résorber le petit creux de 11 heures sans grignoter (ni avoir faim)? Pourquoi le pamplemousse et la pilule sont-ils ennemis ? Avec quelles astuces éviter la maladie du foie gras (maladie du soda)? A partir de quelle quantité d\'alcool mettons-nous notre foie en danger ? A-t-on quand même le droit de se régaler ? S\'appuyant sur les dernières découvertes de la recherche médicale, ce livre passionnant et accessible nous confie des clés pratiques et nous révèle tous les pouvoirs cachés du foie.', 'oui', 256, '11,1 cm × 17,9 cm × 1,5 cm', 'français', '978-2-290-20902-8', '9782290209028'),
	(71, 18, 67, 40, 'Les thérapies cognitives et comportementales', _binary , NULL, '2020-01-08 00:26:45', 'Les thérapies cognitives et comportementales (TCC) se proposent de soigner, de manière adéquate et durable, les patients qui souffrent de dépression, de troubles anxieux ou encore d\'addictions... Traitant les idées négatives et les attitudes inappropriées, elles favorisent l\'apprentissage de conduites plus adaptées à l\'environnement personnel et professionnel. Relativement brèves, scientifiquement évaluées et supposant une étroite collaboration entre le patient et le médecin, elles relèvent d\'un statut particulier du domaine de la psychologie.', 'oui', 128, '11,5 cm × 17,6 cm × 1,1 cm', 'français', '978-2-7154-0264-5', '9782715402645'),
	(72, 18, 68, 41, 'L\'urgence à l\'officine', _binary , NULL, '2020-01-03 00:28:29', 'La pharmacie d\'officine est considérée par le grand public comme un poste de premiers secours permanent. Le pharmacien doit être en mesure de répondre à des situations d\'urgence auxquelles il n\'est pas toujours formé. Rédigé par deux médecins urgentistes et un pharmacien spécialisé dans la formation aux premiers secours, cet ouvrage vous aide à réagir rapidement et logiquement grâce à : des arbres décisionnels (face à une intoxication, face à un traumatisme, face à un malaise, etc.) ; des fiches sur les pathologies nécessitant une prise en charge urgente ; des fiches techniques illustrées expliquant les gestes à effectuer comme le massage cardiaque externe ou la désobstruction des voies aériennes.', 'oui', 326, '14,8 cm × 21,0 cm × 1,8 cm', 'français', '978-2-37519-027-2', '9782375190272'),
	(73, 18, 66, 42, 'Phantastica - Ces substances interdites qui guérissent', _binary , NULL, '2020-02-12 18:00:59', 'Phantastica : c\'est sous cette étiquette oubliée que les substances hallucinogènes apparaissent dans le champ scientifique au XXe siècle. Elles auraient pu révolutionner la psychiatrie. Mais le vent de liberté des années 60 et la diffusion des psychédéliques dans la jeunesse américaine sous forme de LSD, champignons, ou cactus à mescaline ont entraîné une prohibition planétaire, sonnant la fin de recherches en plein essor.', 'oui', 242, '14,0 cm × 20,5 cm × 1,7 cm', 'français', '978-2-246-81879-3', '9782246818793');
INSERT INTO `livre` (`idLivre`, `idCategorie`, `idAuteur`, `idEditeur`, `nom`, `image`, `enSavoirPlus`, `dateDePublication`, `description`, `disponible`, `nbDePage`, `dimension`, `langue`, `isbn`, `ean`) VALUES
	(74, 20, 70, 43, 'Les annales des (très) bien classés 2017-2018-2019 ', _binary , NULL, '2020-02-29 18:06:41', 'Le corrigé des annales des ECNi 2017, 2018 et 2019 pour viser un (très) bon classement !', 'oui', 784, NULL, 'français', ' 978-2-3116-6159-0', NULL),
	(75, 20, 71, 43, 'Les Questions Isolées des (très) bien classés 2016-2017-2018-2019 -', _binary , NULL, '2020-02-29 18:08:51', 'Après L\'Abrégé des (très) bien classés et Les Annales des (très) bien classés, voici Les QI des (très) bien classés, par David Mutin et Aymeric Rouchaud.', 'oui', 560, NULL, 'français', ' 978-2-3116-6173-6', NULL),
	(76, 20, 72, 44, 'Réviser son bac Mathématique', _binary , NULL, '2020-02-29 18:12:16', 'L\'essentiel du cours - Les sujets corrigés - Les articles du Monde - Les conseils de révision\r\nComment préparer au mieux l\'épreuve de mathématiques en terminale S ? Le jour de l\'examen, comment rester serein(e) et rédiger une copie qui saura faire toute la différence ?\r\n\r\nPour vous y aider, voici une collection réalisée en collaboration avec Le Monde et qui a fait ses preuves !\r\nSur chaque thème du programme de mathématiques, il vous propose :\r\n- des fiches de cours claires et efficaces qui synthétisent les connaissances que vous devez maîtriser ;\r\n- de nombreux exercices tirés des sujets récemment tombés au bac, assortis de conseils de méthode pour les traiter ;\r\n- surtout, des articles tirés du journal Le Monde qui vous offrent la possibilité d\'enrichir votre culture mathématique et scientifique.\r\n\r\nCe dernier point en fait un ouvrage particulièrement original.\r\n\r\nTrès accessibles, les articles sont accompagnés d\'un commentaire pédagogique permettant de bien comprendre les enjeux de chaque thème. Ils sont signés notamment par des mathématiciens chevronnés comme Étienne Ghys ou encore Cédric Villani.\r\nDe quoi aborder l\'examen en toute confiance, mais aussi préparer votre éventuelle entrée dans l\'enseignement supérieur.', 'oui', 145, NULL, 'français', '978-2-8208-1028-1', NULL),
	(77, 20, 3, 44, 'Réviser son bac Anglais', _binary , NULL, '2020-02-29 18:15:02', 'L\'essentiel du cours - Les exercices et les sujets corrigés - Les articles en anglais du Courrier international - Les articles du Monde', 'oui', 112, NULL, 'français', ' 978-2-8208-1035-9', NULL),
	(78, 21, 73, 13, 'Au coeur de l\'Armada', _binary , NULL, '2020-02-06 18:26:29', 'Entrez dans la plus grande saga de science-fiction du monde ! Vivez le futur d\'une Humanité dispersée dans l\'Univers, confrontée à d\'autres peuples stellaires et à des puissances d\'ordre supérieur, poussée à se lancer dans des incursions aux conséquences imprévisibles par-delà des gouffres d\'espace et de temps ! Perry Rhodan : une invitation à l\'aventure humaine et spatiale la plus dépaysante, à une captivante réflexion sur la place de l\'Homme dans le cosmos, son origine, son évolution, sa destinée...', 'oui', 320, '10,8 cm × 17,8 cm × 1,4 cm', 'français', '978-2-266-29258-0', '9782266292580'),
	(79, 21, 74, 45, 'La ligue des malfaisants héroïques', _binary , NULL, '2020-01-30 18:46:41', 'Vous aimez l\'imaginaire ? Votre quotidien vous semble atrocement banal ? Vous souhaitez plonger dans une épopée fantastique, et vivre une aventure pleine de rebondissements, digne de vos romans préférés ? N\'hésitez plus et faites comme Sherlock alias Parcy, invoquez Amélius Melgan, le plus mystérieux des marchands d\'épopées. S\'il répond à votre appel, il vous proposera diverses destinations extraordinaires, dans la 5ème dimension.', 'oui', 247, '13,6 cm × 21,0 cm × 2,1 cm', 'français', '978-2-36740-835-4', '9782367408354'),
	(80, 21, 75, 46, 'Kabu Kabu', _binary , NULL, '2020-01-24 18:48:21', 'Avec , plongez dans les méandres des nouvelles de Nnedi Okorafor, l\'autrice de Qui a peur de la mort ? (dont la série est en développement par HBO). Embarquez en direction de l\'aéroport de New York dans un kabu kabu, taxi clandestin qui vous fera traverser les légendes africaines. Découvrez une musicienne qui joue de la guitare pour un zombie particulier. Rencontrez Arro-yo, la coureuse de vents la chevelure maudite, qui se bat pour exister sur l\'étrange planète Ginen.', 'oui', 428, '14,0 cm × 20,0 cm × 3,6 cm', 'français', '978-2-37686-229-1', '9782376862291'),
	(81, 21, 76, 31, 'Le dernier apprenti sorcier Tome 6', _binary , NULL, '2020-02-05 18:50:04', 'A l\'emplacement actuel de Marble Arch, à Londres, se dressait jadis la tristement célèbre potence de Tyburn, surnommée l\'arbre des pendus, où l\'on exécutait les criminels les plus notoires du royaume. Or, de nos jours, les riches demeures d\'Oxford Street et de Mayfair - situées là où les condamnés faisaient autrefois leurs derniers pas - sont le théâtre d\'événements pour le moins étranges et inquiétants.', 'oui', 448, '11,1 cm × 17,7 cm × 2,4 cm', 'français', '978-2-290-17286-5', '9782290172865'),
	(82, 22, 77, 47, 'Programmation de l\'entraînement', _binary , '', '2020-03-17 18:56:29', 'Programmation de l\'entraînement', 'non', 0, '', 'français', '979-10-91285-64-3', '9791091285643'),
	(83, 22, 78, 48, 'Au coeur du MotoGP - Revivez les plus grands moments de la saison MotoGP 2019', _binary , NULL, '2019-10-12 18:58:02', 'Décharge d\'adrénaline et sensations fortes garanties ! Le triomphe d\'un géant, Marc Marquez, l\'éclosion d\'un sacré talent, Fabio Quartararo, l\'abnégation d\'Andrea Dovizioso, la rage d\'Alex Rins, l\'émotion de Danilo Petrucci... Revivez course après course l\'année haletante et pleine d\'émotions du MotoGP ! Interviews exclusives, anecdotes, confidences : retracez le fil d une saison disputée à plus de 300 km/h aux quatre coins de la planète.', 'oui', 256, '22,7 cm × 26,2 cm × 2,8 cm', 'français', '978-2-7576-0413-7', '9782757604137'),
	(84, 22, 79, 49, 'Le loup ', _binary , NULL, '2015-05-19 18:59:53', 'Au coeur du Massif des Ecrins, un grand loup blanc et un berger vont s\'affronter, passionnément, jusqu\'à leurs dernières limites. Jean-Marc Rochette célèbre une nouvelle fois la haute montagne, sa beauté, sa violence, l\'engagement et l\'humilité qu\'il faut pour y survivre.', 'oui', 112, '19,3 cm × 26,9 cm × 1,5 cm', 'français', '978-2-203-19677-3', '9782203196773'),
	(85, 23, 82, 50, 'Le roman d\'un acteur (Tome 2-La Belgique): Épopée burlesque', _binary , NULL, '2019-10-01 19:12:02', 'Ce texte de La Belgique a été établi d\'après les films des spectacles qu\'a réalisés Bernard Dartigues en 1994, lors de leurs dernières représentations au Théâtre de l\'Athénée. Comme celui de L\'âge d\'or, première partie du Roman d\'un acteur, il est très différent de ce qu\'il était aux premières. Il n\'a cessé d\'évoluer au cours des multiples représentations. Ce que je livre aujourd\'hui est le produit et le résultat de cette espèce d\'expérimentation littéraire, cet atelier d\'écriture naturel que ces dernières ont cnstitué, en dehors de leur aspect purement théâtral, éphémère et ludique. Je me suis appliqué à rester au plus près du texte filmé, c\'est-à-dire "oral", en le nettoyant parfois, mais le moins possible. La seule liberté d\' écriture que je me suis donnée est celle des didascalies ; je voulais vraiment que le lecteur "voie" ce que je voyais quand je jouais. Ce que je vois quand je joue. On dit souvent du théâtre que c\'est un "art vivant" ; jamais peut-être cette définition n\'aura été plus appropriée qu\'ici.', 'oui', 752, NULL, 'français', '978-2-0728-6663-0', NULL),
	(86, 23, 81, 51, 'Pelléas et Mélisande', _binary , '', '2012-01-03 19:14:54', 'Une variation supérieure sur l’admirable vieux mélodrame », notait Mallarmé à propos de Pelléas, dont l’intrigue, effectivement, peut sembler bien conventionnelle : le Prince Golaud recueille à l’orée d’un bois une jeune fille dont il va faire son épouse. Mais c’est du frère de Golaud, Pelléas, que Mélisande tombe amoureuse, et le destin fatal qui pèse sur les personnages les mènera inévitablement à la désolation.', 'oui', 0, '12,1 cm × 18,5 cm × 1,2 cm', 'français', '978-2-930646-10-7', '9782930646107'),
	(87, 23, 83, 52, 'Tous les oiseaux', _binary , NULL, '2019-08-21 19:17:33', 'Eperdument amoureux, Eitan et Wahida tentent de résister à la réalité historique à laquelle ils sont confrontés. Mais les choses tournent mal sur le pont Allenby, entre Israël et la Jordanie : victime d\'une attaque terroriste, Eitan tombe dans le coma. C\'est dans cet espace-temps suspendu qu\'il reçoit la visite forcée de ses parents et de ses grands-parents, alors que les chagrins identitaires, le démon des détestations, les idéologies torses s\'enflamment et que les oiseaux du malheur attaquent en piqué le coeur et la raison de chacun.', 'oui', 182, '11,0 cm × 17,5 cm × 1,3 cm', 'français', '978-2-330-12613-1', '9782330126131'),
	(88, 23, 84, 53, 'Les 7 métamorphoses de mytho', _binary , NULL, '2019-09-16 19:19:41', 'Quel est le sens de l\'existence et des valeurs qui donnent le pouvoir de résister à diverses circonstances, sombres ou joyeuses ? Comment savoir à travers les drames de chacun quand l\'imaginaire et la réalité sont en jeu ? Cette pièce évoque la question de la fin de vie et de l\'euthanasie avec des personnages vivant des évènements plus absurdes les uns que les autres. Caya Makhélé convoque la distanciation théâtrale au coeur du drame, en prenant le parti d\'une résilience par le rire.', 'oui', 112, '21,5 cm × 13,5 cm × 0,8 cm', 'français', '978-2-35572-199-1', '9782355721991'),
	(89, 24, 85, 54, 'Madagascar', _binary , NULL, '2019-11-21 22:28:56', 'Ma-da-gas-car ! Ces quatre syllabes ouvrent les portes d\'un monde à part. La Grande Ile posée dans l\'océan Indien cultive ses différences pour le plus grand bonheur des voyageurs. Lémuriens, caméléons, baobabs, tsingy, culte des Ancêtres... chaque journée apporte ici son lot de surprises. Partez à le découverte au fil de routes parfois cahoteuses où l\'aventure est reine.', 'oui', 400, '12,8 cm × 19,6 cm × 2,2 cm', 'français', '978-2-8161-7970-5', '9782816179705'),
	(90, 24, 86, 55, 'Petit Futé Costa Rica', _binary , NULL, '2019-11-06 22:33:33', 'Le Costa Rica est coincé entre deux océans : de l\'ambiance des Caraibes à la douceur du Pacifique. C\'est aussi un pays de montagnes d\'une formidable richesse naturelle. Depuis la création, en 1963, du premier parc à Cabo Blanco, le Costa Rica n\'a cessé d\'augmenter la surface de ses parcs naturels, plus de 27 % du territoire. Volcans actifs et endormis, jungles luxuriantes, eaux claires et fonds marins riches, air pur au sommet des montagnes...', 'oui', 504, NULL, 'français', '978-2-305-02166-9', '9782305021669'),
	(91, 24, 87, 54, 'Japon', _binary , NULL, '2020-01-02 22:36:29', 'S\'étirant de la mer de Chine orientale à celle d\'Okhotsk, ce vaste archipel volcanique est passé maître dans l\'art de la résilience - façonnant l\'une des cultures les plus fascinantes au monde - et dans celui de bousculer les a priori. Au-delà de la trilogie Tokyo-mont Fuji-Kyoto, le pays réserve ses plus beaux atours à qui prend le temps de sortir des sentiers battus et de rencontrer ses habitants.', 'oui', 960, '13,0 cm × 19,5 cm × 4,2 cm', 'français', '978-2-8161-8411-2', '9782816184112'),
	(92, 24, 88, 56, 'Cuba', _binary , NULL, '2020-01-09 22:38:12', 'Sensuelle, parfois surréaliste, l\'île de Cuba offre le meilleur des Caraïbes et de l\'Amérique latine. Que l\'on souhaite déambuler dans les rues de la vieille ville de La Havane, que l\'on soit amateur d\'oiseaux ou de vieilles voitures américaines, que l\'on aime les villes coloniales, les montagnes ou les plages des Caraïbes... Cuba offre une multiplicité de voyages ! ¿ Retrouvez toute l\'expertise de National Geographic et toujours des cartes et plans détaillés ¿ Un format réduit et un papier allégé plus pratique à manier et à emporter ¿ Une couverture plus moderne avec pelliculage mat et vernis sélectif ¿ Des gros plans thématiques sur l\'histoire du pays, sa culture et son patrimoine ¿ Des doubles pages promenades pour vous guider ¿ Un guide d\'adresses sélectionnées par National Geographic ¿ Et toujours le + numérique des guides actualisés en temps réel sur le site NG en partenariat avec Tripadvisor', 'oui', 271, '12,6 cm × 20,0 cm × 1,5 cm', 'français', '978-2-8229-0247-2', '9782822902472'),
	(93, 25, 89, 57, 'Edens Zero Tome 7 ', _binary , NULL, '2020-01-29 15:51:33', 'Xiaomei, la liseuse du temps, a révélé à Shiki et ses amis que Valkyrie se trouvait sur Sun Jewel, la planète des joyaux, contrôlée par la Dame écarlate et réputée comme l\'un des lieux les plus paisibles de tout le cosmos. Pourtant, Shiki et Homura sont rapidement arrêtés et envoyés dans la zone de travaux forcés où ils découvrent l\'enfer que vivent une partie des habitants de Sun Jewel. La Dame écarlate qui montre un intérêt inquiétant pour l\'Edens Zero, Rebecca qui fait équipe avec Laviria, et un homme qui se présente comme un disciple de Valkyrie : autant de situations étonnantes qui se présentent aux yeux de nos amis...', 'oui', 192, '12,4 cm × 18,0 cm × 1,6 cm', 'français', '978-2-8116-5232-6', '9782811652326'),
	(94, 25, 90, 58, 'Dragon Ball Super Tome 7', _binary , NULL, '2019-05-02 15:55:54', 'Le coup d\'envoi du tournoi du plus fort, qui décidera du sort des univers, a été lancé. L\'équipe de l\'univers 7, celle de Goku, est enfin au grand complet grâce au recrutement de dernière minute d\'un ancien ennemi : Freezer est désormais de la partie !! Goku et ses coéquipiers se lancent donc dans une grande battle royale. Mais très vite, Freezer se rapproche de Frost, son alter-ego de l\'univers 6.', 'oui', 192, '11,8 cm × 18,0 cm × 1,3 cm', 'français', '978-2-344-03632-7', '9782344036327'),
	(95, 25, 91, 59, 'Naruto Tome 2', _binary , NULL, '2002-04-11 15:57:53', 'Très bon tome de la série phare des éditions kana : "Naruto" prend de l\'ampleur avec ce tome intéressant où l\'épreuve de survie prend fin et un nouveau chapitre commence.', 'oui', 205, '11,5 cm × 17,5 cm × 1,4 cm', 'français', '2-87129-417-8', '9782871294177'),
	(96, 25, 92, 1, 'My Hero Academia Tome 20', _binary , NULL, '2019-09-05 16:00:14', 'C\'est bientôt la fête de Yuei ! L\'occasion pour tout le lycée de se changer les idées... Les élèves de seconde A sont remontés à bloc et décident de donner un concert détonant, avec l\'aide de Kyoka ! Pour Izuku, c\'est aussi une chance unique de rendre le sourire à la petite Eri... Seulement, deux individus avides de gloire ont jeté leur dévolu sur la fameuse école de super-héros, et comptent bien s\'y infiltrer...', 'oui', 154, '11,5 cm × 17,5 cm × 2,2 cm', 'français', '979-10-327-0482-0', '9791032704820');
